class Table extends React.Component{
    constructor(props){
        super(props);
    }
    
    render(){
        return(
            <div className="table">
               <div className="deck">
                    <div title="Колода" area-label="Колода" className="card back" id={this.props.id}>
                        <button title="Колода" area-label="Колода" onClick={this.props.onClick} >
                            {this.props.length}
                        </button>
                    </div>
               </div>
               
               <div className="cards">
                    {this.props.rows}
               </div>

            </div>
        )
    }
}

class Card extends React.Component {
    constructor(props) {
        super(props)
    }
    
    render() {
        return (
                <div className={this.props.containerClass}>
                    <button title="Карта" className={this.props.className} area-label="Карта" onClick={this.props.onCardClick}>
                    <div className="text">{this.props.text}</div>
                    </button>
                </div>
        )
    }
}

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            cardOnTable: [],
            cardInDeck: this.shuffle([11, 12, 13, 14, 15, 16, 17, 18, 21, 22, 23, 24, 25, 26, 27, 28, 31, 32, 33, 34, 35, 36, 37, 38, 41, 42, 43, 44, 45, 46, 47, 48, 51, 52, 53, 54, 55, 56, 57, 58, 61, 62, 63, 64, 65, 66, 67, 68, 71, 72, 73, 74, 75, 76, 77, 78, 81, 82, 83, 84, 85, 86, 87, 88]),
            cardGone: [],
            hodZaya: true,
            scoreZaya: 0,
            scoreDed: 0,
        };
        
        this.addCardOnTable = this.addCardOnTable.bind(this);
        this.hasDouble = this.hasDouble.bind(this);
        this.getCards = this.getCards.bind(this);
        this.countSum = this.countSum.bind(this);
        this.getStatus = this.getStatus.bind(this);
        this.isDouble = this.isDouble.bind(this);
        this.lastDeer = this.lastDeer.bind(this);
        this.shuffle = this.shuffle.bind(this);
        this.oneDeer = this.oneDeer.bind(this);
        
    }
    
    oneDeer(){
        const cardOnTable = this.state.cardOnTable
        for (let j = 0; j < cardOnTable.length-1; j++) {
            if (4 == ~~(cardOnTable[j]/10)) {
                console.log('two deers');
                return false;
            }
        }
        return true;
    }
    
    shuffle(arr) {
        let currentIndex = arr.length, temporaryValue, randomIndex;
        while (0 !== currentIndex) {
            randomIndex = ~~(Math.random() * currentIndex);
            currentIndex -= 1;
            temporaryValue = arr[currentIndex];
            arr[currentIndex] = arr[randomIndex];
            arr[randomIndex] = temporaryValue;
        }
        
        return arr;
    }
    
    lastDeer(){
        const cardOnTable = this.state.cardOnTable
        console.log('deer ' + ~~(cardOnTable[cardOnTable.length - 1]/10) == 4)
        return (~~(cardOnTable[cardOnTable.length - 1]/10) == 4);
    }
    
    isDouble(i){
        const cardOnTable = this.state.cardOnTable
        for (let j = 0; j < cardOnTable.length; j++) {
            if (~~(cardOnTable[i]/10) == ~~(cardOnTable[j]/10) && i!=j) {
                return 'animate';
            }
        }
        return '';
    }
    
    getStatus(player){
        const cardOnTable = this.state.cardOnTable
        const cardInDeck = this.state.cardInDeck
        let scoreDed = this.state.scoreDed
        let scoreZaya = this.state.scoreZaya
        let hodZaya = this.state.hodZaya
        
        if (cardOnTable.length == 0 && cardInDeck.length == 0) {
            if (player == 1) {
                return scoreDed >= scoreZaya ? 'winner' : '';
            } else {
                return scoreDed > scoreZaya ? '' : 'winner';
            }
        } else {
            if (player == 1) {
                return !hodZaya ? 'active' : '';
            } else {
                return hodZaya ? 'active' : '';
            }
        }
    }
    
    
    countSum(){
        const cardOnTable = this.state.cardOnTable
        const cardGone = this.state.cardGone
        let sum = 0;
        let j = cardOnTable.length-1;
        
        if (this.hasDouble()){
            while ( ~~(cardOnTable[j]/10) !== 3 && j > 0) {
                j--;
            }
            
            for(let i = j-1; i>=0; i--) {
                sum += (cardOnTable[i] % 10);
            }
            
            for (let i = j; i<cardOnTable.length; i++) {
                cardGone.push(cardOnTable[i]) ;
            }
            console.log('cardGone ' + cardGone);
        } else {
            let fox = false;
            let wolf = false;
            
            for (let i = cardOnTable.length-1; i>=0; i--) {
                sum += (cardOnTable[i] % 10);
                ~~(cardOnTable[i]/10) == 1 ? wolf=true : undefined;
                ~~(cardOnTable[i]/10) == 2 ? fox=true : undefined ;
                console.log('wolf ' + wolf);
                console.log('fox '+ fox);
            }
            
            if (fox && wolf) {
                console.log('cardGone' + cardGone);
                for (let i = ((cardOnTable.length > cardGone.length) ? cardGone.length - 1 : cardOnTable.length - 1); i>=0; i--) {
                    console.log('cardGone' + cardGone);
                    sum += (cardGone.pop() % 10);
                }
            }
        }
        
        this.setState({cardOnTable: cardOnTable,
                      cardGone: cardGone });
        
        return sum;
    }
    
    getCards() {
        let hodZaya = this.state.hodZaya;
        let scoreZaya = this.state.scoreZaya;
        let scoreDed = this.state.scoreDed;
        const cardOnTable = this.state.cardOnTable;
        
        if (hodZaya){
            scoreZaya += this.countSum();
        } else {
            scoreDed += this.countSum();
        }
        hodZaya=!hodZaya;
        cardOnTable.splice(0, cardOnTable.length);
        
        this.setState({ cardOnTable: cardOnTable,
                        hodZaya: hodZaya,
                        scoreZaya: scoreZaya,
                        scoreDed: scoreDed });
    }
    

    addCardOnTable(){
        const cardOnTable = this.state.cardOnTable
        const cardInDeck = this.state.cardInDeck
        
        if (cardInDeck.length > 0) {
            cardOnTable.push(cardInDeck.shift());
            console.log(cardOnTable);
            console.log(cardInDeck);
        }
                      
        this.setState({cardOnTable: cardOnTable,
                        cardInDeck: cardInDeck});
    }
    
    hasDouble(){
        const cardOnTable = this.state.cardOnTable
        
        console.log(new Set(cardOnTable).size);
        console.log(cardOnTable.length);
        
        const array = cardOnTable.slice();
        
        for (let i = 0; i < cardOnTable.length; i ++) {
            array[i] = ~~(array[i]/10);
        }
        
        return (new Set(array)).size !== array.length;
    }
    
    renderRows(){
        
    }
    render() {
        const rows = this.state.cardOnTable.map((card, i) => {
                                   let className = 'card card';
                                   className += ~~(card/10);
                                   return <Card containerClass={className} className={this.hasDouble() ? this.isDouble(i) : undefined} onCardClick={(this.lastDeer() && this.oneDeer() && this.state.cardInDeck.length > 0) ?  undefined : this.getCards} text={card%10} />
                   })
        
        return (
                <div className="main-grid">
                    <Reset />
                    <Player status={this.getStatus(1)} name="Дед Мазай" num="1" score={this.state.scoreDed} />
                    <Table id={this.state.cardInDeck.length <= 0 ? 'none' : undefined} onClick={this.hasDouble() ? undefined : this.addCardOnTable} length={this.state.cardInDeck.length} rows={rows} />
                    <Player status={this.getStatus(2)} name="Зайцы"  num="2" score={this.state.scoreZaya} />
                </div>
        );
    }
}

